import React from 'react'
import styles from './FormControls.module'

export const Textarea = ({ input, meta, ...props }) => {
    return (
        <div styles={styles.formControl}>
            <div> 
                <textarea {...input} {...props} />
            </div>
            {meta.error && <span>{'some erroe'}</span>}
        </div>
    )
}
